import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Type "music" in the search input field
    await page.waitForSelector('input.search-input');
    await page.fill('input.search-input', 'music');

    // Take screenshot after entering the search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Click the search button
    await page.waitForSelector('button.search-btn');
    await page.click('button.search-btn');

    // Wait for the results to load
    await page.waitForSelector('.video-item:first-child');

    // Take screenshot of the search results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Click on the first video result
    await page.click('.video-item:first-child');

    // Take screenshot after clicking the first video
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_video_playing.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_video_playing.png'));

    return {
      success: true,
      action: "Searched for 'music' and clicked on the first video result",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

